async function webXmpp(stan, num, vic) {

  let numb = 0;

  while (numb <= num) {

    console.log(stan);

    Kik.sendXmpp(vic, stan);

    await new Promise(resolve => setTimeout(resolve, delay));

    numb += 1;

  }

}

